SET FOREIGN_KEY_CHECKS = 0;
DROP TABLE IF EXISTS `others_banks`;

CREATE TABLE `others_banks` (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `logo` varchar(255) DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  `code` varchar(255) NOT NULL,
  `processing_time` varchar(255) NOT NULL,
  `processing_type` enum('days','hours') NOT NULL,
  `charge` varchar(255) NOT NULL,
  `charge_type` enum('percentage','fixed') NOT NULL,
  `minimum_transfer` decimal(15,2) NOT NULL DEFAULT 0.00,
  `maximum_transfer` decimal(15,2) NOT NULL DEFAULT 100.00,
  `daily_limit_maximum_amount` decimal(12,2) NOT NULL DEFAULT 100.00,
  `daily_limit_maximum_count` int(11) NOT NULL DEFAULT 0,
  `monthly_limit_maximum_amount` decimal(12,2) NOT NULL DEFAULT 1000.00,
  `monthly_limit_maximum_count` int(11) NOT NULL DEFAULT 0,
  `field_options` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`field_options`)),
  `details` text DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT 0,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `others_banks_code_unique` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

SET FOREIGN_KEY_CHECKS = 1;